import React, {useEffect, useState} from 'react';
import {useSelector} from "react-redux";
const OrderList = () =>{
    const isAdmin = useSelector((state) => state.user.isAdmin);


    return (
        <div>
            {isAdmin ? (
                <div>

                </div>
            ):(
                <div>
                    <h1></h1>
                </div>
            )}

        </div>
    )
}
